ntact karate that allows the use of throws, choke hold, grappling, and striking techniques (including facial punching), founded by Takashi Azuma, who left Kyokushin kaikan","ryu":"極真会館を離脱した東孝が創立した投げ技、締め技、関節技、打撃技(顔面パンチを含む)の使用を認めるフルコンタクト空手をベースとした総合格闘技","ast":"artes marciales mistes basaes nel karate de contautu total que permite l’usu de téuniques de proyeición, estrangulamientu, agarre y golpes (incluyíos los puñetazos faciales), fundaes por Takashi Azuma, quien dexó Kyokushin kaikan","bg":"Смесени бойни изкуства, базирани на карате с пълен контакт, които позволяват използването на хвърляния, задушаване, граплинг и ударни техники (включително лицеви удари), основани от Такаши Азума, който напусна Киокушин кайкан","ca":"arts marcials mixtes basades en el karate de contacte complet que permet l'ús de tècniques de llançament, asfixia, grappling i cops (inclosos cops de puny facial), fundada per Takashi Azuma, que va deixar Kyokushin kaikan","fa":"هنرهای رزمی ترکیبی مبتنی بر کاراته تمام تماس که امکان استفاده از پرتاب، نگه داشتن خفه کردن، چنگ زدن و تکنیک‌های ضربه‌ای (از جمله مشت زدن به صورت) را می‌دهد، توسط تاکاشی آزوما، که کیوکوشین کایکان را ترک کرد، تأسیس شد.","hu":"a Kyokushin kaikant elhagyó Takashi Azuma alapítója a full-contact karatén alapuló vegyes harcművészet, amely lehetővé teszi a dobások, a fojtástartás, a birkózás és az ütési technikák használatát (beleértve az arcütést is).","it":"arti marziali miste basate sul karate a pieno contatto che consente l'uso di tecniche di lancio, presa soffocante, prese e colpi (compresi i pugni facciali), fondate da Takashi Azuma, che ha lasciato Kyokushin kaikan","kk":"Киокушинкайканнан кеткен Такаши Азума негізін қалаған, лақтыру, тұншықтырып ұстау, грэпплинг және соққы әдістерін қолдануға мүмкіндік беретін толық контактілі каратэге негізделген аралас жекпе-жек өнері","ko":"극진회관을 떠난 아즈마 다카시가 창시한 던지기, 초크, 잡기, 타격기(안면 펀치 포함)를 구사할 수 있는 풀 컨택트 가라테를 기반으로 한 종합격투기","pt":"artes marciais mistas baseadas no karatê de contato total que p